import React from 'react'
 

const DisplaySearchDispaly=(props)=>{

    const listmeal=({mealData})=>{
        if(mealData)
        {
            return mealData.map((item)=>{


                return (
                    <div>
                    {item.name}
                    </div>
                )
            })

        }
            
        
        }
    return(
        <div>
   <h4>Quick Search</h4>
   {listmeal(props)};
   </div>
    )
}
export default DisplaySearchDispaly;
